import Container from 'react-bootstrap/Container';
import 'bootstrap/dist/css/bootstrap.min.css';
import Background from './Background';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Navbar1 from './Navbar1';
import Card1 from './Card1';
import './Grid1.css';
import PropTypes from 'prop-types'

import Button1 from './Button1';
import Titles1 from './Titles1';
import Logo from './Logo';
import SearchBar from './Searchbar';

function Grid1() {
  return (
  <Container> 
    <Logo/>
  <Row>
      <Navbar1/>
  </Row>
  <Row></Row>
  <Row></Row>
  <Row> <Col><SearchBar label="Search for restaurants"/></Col>
  <Col><SearchBar label="Search by Location"/></Col>
  </Row>
  <Row>
      <Col><Titles1 word="Restaurants"/></Col>
      <Col><Titles1 word="Rating"/></Col>
      <Col><Titles1 word="Reviews"/></Col>
  </Row>
  <Row>
        <Col xs={4}><Card1/></Col>
        <Col xs={4}><Card1/></Col>
        <Col xs={4}><Card1/></Col>
  </Row>
  <Row>
        <Col xs={4}><Card1/></Col>
        <Col xs={4}><Card1/></Col>
        <Col xs={4}><Card1/></Col>
  </Row>
  </Container>
  );
}

export default Grid1;
